✨ 💛 🙎 МАСКИ С КУРКУМОЙ 🙎 💛 ✨ 

🍯 Маска из куркумы и меда. 

✍🏻 Измельчить 10 граммов специи в порошок и добавить к ним 25 граммов жидкого меда и 25 граммов сливок. Маску нанести на все лицо и смыть через 15 минут. Такую маску рекомендуется использовать 1 раз в неделю; 

🍚 Маска из куркумы от морщин с творогом. 

✍🏻 Измельчают в блендере 25 граммов жирного творога, добавляют в него 15 миллилитров подогретого молока, и засыпают 20 граммов куркумы. Маска распределяется по лицу, затем через 20 минут смывается. Ее также наносят раз в неделю; 

🍂 Сметанная маска с пряностями с лифтинг эффектом. 

✍🏻 Добавить к 20 миллилитрам сметаны 10 миллилитров оливкового масла, немного подогреть смесь и всыпать 12 граммов порошка куркумы. Маску оставляют на лице на 20 минут, после смывают; 

💛 Маска из белой глины и куркумы. 

✍🏻 Смешивают 1 чайную ложку глины с щепоткой куркумы и добавляют в смесь молоко до получения густой консистенции. Смесь наносят на кожу лица, а через 20 минут смывают; 

💖 Маска с эфирными маслами и пряностями. 

✍🏻 Это самый простой вид маски, она помогает сделать кожу более эластичной. Для маски используют щепотку специй и немного любого эфирного масла. Смесь наносят на лицо на 20 минут; 

👀 Маска для глаз из куркумы и соды. 

✍🏻 Такая маска убирает темные круги под глазами и уменьшает мимические морщины. Пряность запускает процессы регенерации клеток, а сода усиливает эффект куркумы. Для маски замораживают кубик минеральной воды. Смешивают 10 граммов соды и 5 граммов куркумы, а в центре этой массы кладут кубик льда. Когда лед растает, маску наносят под глаза. При отечности и мешках в эту смесь также добавляют 5 капель лимонного сока; 

👼 Омолаживающая паста для тела из куркумы. 

✍🏻 Для приготовления пасты добавляют в 1/3 стакана растительного масла, чайную ложку пряностей и 3 капли эфирных масел. Во время принятия душа этой пастой хорошо натирают все тело. Такая паста смягчает кожу и делает ее подтянутой.

